def normalize_symbol_name(symbol_name):

    if symbol_name == "\\frac":
        return "\\frac{}{}"  # noqa
    elif symbol_name == "\\sqrt":
        return "\\sqrt{}"  # noqa
    elif symbol_name in ["&lt;", r"\lt"]:
        return "<"
    elif symbol_name in ["&gt;", r"\gt"]:
        return ">"
    elif symbol_name == "{":
        return r"\{"
    elif symbol_name == "}":
        return r"\}"
    return symbol_name

