def tile_to_board_index(tile_index, board_index):

    if 4 <= tile_index <= 7:
        row_offset = 1
    else:
        row_offset = 0
    if tile_index in [1, 6]:
        column_offset = 1
    elif tile_index in [2, 5]:
        column_offset = 2
    elif tile_index in [3, 4]:
        column_offset = 3
    else:
        column_offset = 0
    return (board_index[0] * 2 + row_offset, board_index[0] * 3 + column_offset)

