def lr_schedule(epoch):

    lr = 1e-3
    if epoch % 10 == 9:
        lr *= 0.5e-3
    elif 6 <= epoch % 10 < 9:
        lr *= 1e-3
    elif 3 <= epoch % 10 < 6:
        lr *= 1e-2
    elif epoch % 10 < 3:
        lr *= 1e-1
    print('Learning rate: ', lr)

    return lr

