def calculate_performance_score(stat_arr, beta):

    tp, fp, fn = stat_arr[0], stat_arr[1], stat_arr[2]

    if beta > 100:
        numerator = tp
        denominator = tp + fn
    else:
        numerator = (1 + beta * beta) * tp
        denominator = (1 + beta * beta) * tp + beta * beta * fn + fp
