    return rot_matrix.dot(tensor).dot(rot_matrix.T)

def ternary_search(f, lo, hi, gap=1e-10):

    while hi - lo > gap:
        step = (hi - lo) / 3.
        if f(lo + step) < f(lo + 2 * step):
            lo += step
        else:
            hi -= step
    return lo

def _color_is_black(color):

    try:
        color = color.lower()
    except AttributeError:
        pass
    return color in ('#000', '#000000', 'black', (0, 0, 0), (0, 0, 0, 255),
                     (0, 0, 0, 1.0))

def lr_schedule(epoch):

    lr = 1e-3
    if epoch % 10 == 9:
        lr *= 0.5e-3
    elif 6 <= epoch % 10 < 9:
        lr *= 1e-3
    elif 3 <= epoch % 10 < 6:
        lr *= 1e-2
    elif epoch % 10 < 3:
        lr *= 1e-1
    print('Learning rate: ', lr)

    return lr

