def sec2str(t):


    # Decompose into hour, minute and seconds.
    h = int(t // 3600)
    m = int((t - 3600 * h) // 60)
    s = t - 3600 * h - 60 * m

    # Print digits if non-int seconds
    if isinstance(s, int):
        s_str = '{:d}'.format(s)
    else:
        s_str = '{:.2f}'.format(float(s))

    # Display info depending on available elements.
    if h == 0 and m == 0:
        return "{}s".format(s_str)

    elif h == 0 and m != 0:
        return "{:d}m {}s".format(m, s_str)

    else:
        return "{:d}h {:d}m {}s".format(h, m, s_str)

def sqrt(number):

    if type(number) != int:
        return "INVALID INPUT, ENTER AN INTEGER!"
    start, end = 0, number + 1
    while start < end:
        mid = start + (end - start)//2
        if mid*mid == number :
            return mid
        elif (end - start) == 1:
            return start
        elif mid*mid > number:
            end = mid 
        else:
            start = mid

def convert_temperature(temp_in, units_in, units_out):


    temp_out = None
    if units_in == 'F':
        if units_out == 'C':
            temp_out = (temp_in - 32) * (5./9.)
        else:
            temp_out = temp_in

    elif units_in == 'C':
        if units_out == 'C':
            temp_out = temp_in
        else:
            temp_out = (temp_in * (9./5.)) + 32

    return temp_out

