def subalternative(key, alt):

  assert " " not in key
  assert " " not in alt
  keyparts, altparts = key.split("."), alt.split(".")
  while keyparts and altparts:
    a, b = keyparts.pop(0), altparts.pop(0)
    if a != b:
      raise KeyError()
  return ".".join(altparts)

def parse_charge(charge_str):

